fields:
  - name: Value
    type: number
  - name: Year
    type: integer
  - name: Measure
    type: string
  - name: Observation status
    type: string
  - name: Unit multiplier
    type: string
  - name: Unit measure
    type: string
  - name: Sex
    type: string
    constraints:
      enum:
        - ""
        - Male
        - Female
  - name: Age
    type: string
    constraints:
      enum:
        - 1.5 to 3
        - 4 to 10
        - 11 to 18
        - 19 to 64
        - 65 to 74
        - 65 and over
        - 75 and over
